Nous vous remercions pour votre message. 
A l'exception des courses vers et depuis les aéroports, les compagnies de taxis ne sont pas autorisées à pratiquer de tarification au forfait.

@Toniodu7 Bonsoir Monsieur,
Le montant qui vous a été - apparemment - débité sera tout simplement supprimé de votre relevé de compte, ou contrebalancé par une écriture en sens inverse.
Il s'agit là de pratiques propres aux établissements bancaires, et sur lesquelles nous n'avo...

@Toniodu7 Ce montant vous sera recrédité par votre banque dans un délai allant de quelques heures à quelques jours en fonction des établissements.
Nous vous souhaitons une bonne soirée.
L'équipe G7

@Toniodu7 Bonjour Monsieur,
Nous vous remercions pour votre message.
Le montant de 30€ que vous évoquez correspond à une opération de validation effectuée lors de l'inscription d'une nouvelle carte bancaire.
